import React from 'react';
import Mymodal from './Mymodal'

function Next(props) {
    return (
        <div>
            {/* <i data-toggle="modal" data-target="#myModal" types={props.types} style={{fontSize:'24px',cursor:'pointer'}} class="fa">&#xf101;</i> */}
            <i onclickevent={props.onclickevent} types={props.types} style={{fontSize:'24px',cursor:'pointer'}} class="fa">&#xf101;</i>
            <Mymodal />
        </div>
    );
}
export default Next;
